import React, { useState, useEffect } from 'react';
import ChartTabs from '../dashboard/ChartTabs';
import { 
  TrendingUp, 
  User, 
  RefreshCw, 
  LogOut,
  Activity,
  XCircle,
  BarChart3,
  Bell,
  Settings,
  Zap,
  Copy,
  Check,
  Wallet,
  Bot   // ✅ Importando ícone do botão Trading Bots
} from 'lucide-react';
import { useTheme } from '../../contexts/ThemeContext';
import ThemeToggle from '../common/ThemeToggle';

function DashboardPage({
  user,
  lastUpdate,
  isRefreshing,
  onRefresh,
  onLogout,
  isMonitoring,
  selectedCryptos,
  monitoringInterval,
  onStartStopMonitoring,
  monitoringEmail,
  setMonitoringEmail,
  setMonitoringInterval,
  buyThreshold,
  setBuyThreshold,
  sellThreshold,
  setSellThreshold,
  availableCryptos,
  onToggleCryptoSelection,
  onClearSelection,
  onNavigateToPortfolio,
  onNavigateToBots   // ✅ Recebe função de navegação para bots
}) {
  const { colors } = useTheme();
  const [copiedEmail, setCopiedEmail] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [sortBy, setSortBy] = useState('marketCap');
  const [hoveredCrypto, setHoveredCrypto] = useState(null);

  const copyEmailToClipboard = () => {
    navigator.clipboard.writeText(monitoringEmail);
    setCopiedEmail(true);
    setTimeout(() => setCopiedEmail(false), 2000);
  };

  const filteredCryptos = availableCryptos
    .filter(crypto =>
      crypto.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      crypto.symbol.toLowerCase().includes(searchTerm.toLowerCase())
    )
    .sort((a, b) => {
      if (sortBy === 'marketCap') return (b.marketCap || 0) - (a.marketCap || 0);
      if (sortBy === 'price') return (b.currentPrice || 0) - (a.currentPrice || 0);
      if (sortBy === 'change') return (b.priceChange24h || 0) - (a.priceChange24h || 0);
      return 0;
    });

  const averageChange = selectedCryptos.length > 0
    ? selectedCryptos.reduce((sum, crypto) => sum + (crypto.priceChange24h || 0), 0) / selectedCryptos.length
    : 0;

  const styles = {
    container: {
      minHeight: '100vh',
      background: colors.bgGradient,
      transition: 'background 0.5s ease'
    },
    header: {
      background: colors.headerBg,
      borderBottom: '3px solid #667eea',
      padding: '20px',
      boxShadow: `0 2px 10px ${colors.shadowColor}`,
      transition: 'all 0.5s ease'
    },
    headerContent: {
      maxWidth: '1400px',
      margin: '0 auto',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      flexWrap: 'wrap',
      gap: '15px'
    },
    logoContainer: {
      display: 'flex',
      alignItems: 'center',
      gap: '15px'
    },
    logo: {
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      padding: '12px',
      borderRadius: '12px'
    },
    headerButtons: {
      display: 'flex',
      gap: '12px',
      alignItems: 'center',
      flexWrap: 'wrap'
    },
    userBadge: {
      background: colors.cardBgSecondary,
      padding: '8px 16px',
      borderRadius: '8px',
      fontWeight: 'bold',
      fontSize: '14px',
      display: 'flex',
      alignItems: 'center',
      gap: '8px',
      color: colors.text
    },
    button: {
      padding: '8px 16px',
      borderRadius: '8px',
      cursor: 'pointer',
      fontWeight: 'bold',
      display: 'flex',
      alignItems: 'center',
      gap: '8px',
      fontSize: '14px',
      border: 'none',
      transition: 'transform 0.2s'
    }
  };

  return (
    <div style={styles.container}>
      {/* Header */}
      <div style={styles.header}>
        <div style={styles.headerContent}>
          <div style={styles.logoContainer}>
            <div style={styles.logo}>
              <TrendingUp size={32} color="white" />
            </div>
            <div>
              <h1 style={{ margin: 0, fontSize: '24px', fontWeight: 'bold', color: colors.text }}>
                Crypto Monitor
              </h1>
              <p style={{ margin: 0, color: colors.textSecondary, fontSize: '13px' }}>
                {lastUpdate && `Atualizado ${lastUpdate.toLocaleTimeString()}`}
              </p>
            </div>
          </div>

          <div style={styles.headerButtons}>
            <ThemeToggle />
            <div style={styles.userBadge}>
              <User size={18} color="#667eea" />
              {user?.username}
            </div>

            <button
              onClick={onNavigateToPortfolio}
              style={{
                ...styles.button,
                background: '#10b981',
                color: 'white'
              }}
            >
              <Wallet size={16} />
              Portfolio
            </button>

            {/* ✅ Novo botão Trading Bots */}
            <button
              onClick={onNavigateToBots}
              style={{
                ...styles.button,
                background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
                color: 'white'
              }}
            >
              <Bot size={16} />
              Trading Bots
            </button>

            <button
              onClick={onRefresh}
              disabled={isRefreshing}
              style={{
                ...styles.button,
                background: '#667eea',
                color: 'white',
                opacity: isRefreshing ? 0.5 : 1
              }}
            >
              <RefreshCw 
                size={16} 
                style={{ animation: isRefreshing ? 'spin 1s linear infinite' : 'none' }} 
              />
              Atualizar
            </button>

            <button
              onClick={onLogout}
              style={{
                ...styles.button,
                background: '#ff4444',
                color: 'white'
              }}
            >
              <LogOut size={16} />
              Sair
            </button>
          </div>
        </div>
      </div>

      {/* ⬇️ O resto do conteúdo permanece inalterado ⬇️ */}
      {/* ... */}

      <style>{`
        @keyframes spin {
          from { transform: rotate(0deg); }
          to { transform: rotate(360deg); }
        }
      `}</style>
    </div>
  );
}

export default DashboardPage;
